import React from "react";

const ArtistSearchResult = (props) => {
  return (
    <div className="flex items-center rounded-lg m-2 pl-40">
      <div className="flex hover:scale-110 transition ease-in-out duration-100 place-items-center">
        <img
          className="rounded-lg"
          height={60}
          width={60}
          src={props.link}
          alt=""
        ></img>
        <div>{props.artistName}</div>
      </div>
    </div>
  );
};

export default ArtistSearchResult;
